import React from "react";
import { BrowserRouter, Route, Link } from "react-router-dom";
import './Navbar.css';

function Navbar() {
  return (
    <div className='nav'>
      <p>CALI RIVERA</p>

    <nav>
          <Link to="/work">WORK</Link>
          <Link to="/about">ABOUT</Link>
    </nav>
    </div>
  );
}

export default Navbar;
